import { Button, Typography } from "@material-ui/core";
import { useState } from "react";

const AppointmentForm = () => {
  const [step, setStep] = useState(0);

  switch (step) {
    case 0:
      return <AssistanceType />;
    case 1:
      return <FirstStep />;
    case 2:
      return <SecondStep />;
  }
};

const AssistanceType = () => {
  return (
    <div align="center">
      <Typography variant="h5">What do you seek?</Typography>
      <Button variant="contained" onClick={() => setStep(1)}>
        Counseling
      </Button>
      <br />
      <Button variant="contained" color="primary" onClick={() => setStep(1)}>
        Legal Guidance
      </Button>
      <br />
      <Button variant="contained" color="secondary" onClick={() => setStep(1)}>
        Legal Action
      </Button>
    </div>
  );
};

const FirstStep = () => {
  return (
    <div align="center">
      <h1>step 1</h1>
      <Button onClick={() => setStep(1)}>Next</Button>
    </div>
  );
};

const SecondStep = () => {
  return (
    <div align="center">
      <h1>step 2</h1>
      <Button>Submit</Button>
    </div>
  );
};

export default AppointmentForm;
